            //   console.log("project.amount * PRECISION  * PRECISION",project.amount * PRECISION  * PRECISION);
            //   console.log("pricefromFeed * ADDITIONAL_FEED_PRECISION",pricefromFeed * ADDITIONAL_FEED_PRECISION);
